import React from 'react';
import { Link } from "react-router-dom";
export const Navbar = () => {
  return (
    <div className='nav-margin'>
        <nav>
        <Link style={({isActive}) => {return {color:'skyblue'}}} className="link-color" to="/">Home</Link>&nbsp;&nbsp;&nbsp;&nbsp;
        <Link className="link-color" to="/my-todo-list">My Todo List</Link>&nbsp;&nbsp;&nbsp;&nbsp;
        <Link className="link-color" to="/about">About</Link>
        </nav>
        <br />
    </div>
    
  )
}
